    [],nt"num_tags": 3,nt"name": "pocasse-national-wildlife-refuge-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Pocasse
    NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses compliance with environmental and cultural resource
    mandates. Habitat management is also covered; subjects include wetlands, grasslands,
    haying, and pest control. The wildlife section of the report discusses endangered
    and threatened species, waterfowl, marsh birds and waterbirds, raptors, game mammals,
    and fisheries resources. The public uses of the Refuge described in this report
    include hunting, fishing, and law enforcement. The equipment and facilities section
    of the report provides information about rehabilitation. Cooperative programs and
    items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
